    def test_image_types(self):

        d: Document = Document()

        p: Page = Page()
        d.append_page(p)

        # useful constant(s)
        x: int = p.get_size()[0] // 10
        y: int = p.get_size()[1] // 10
        w: int = p.get_size()[0] - 2 * (p.get_size()[0] // 10)
        h: int = p.get_size()[1] - 2 * (p.get_size()[1] // 10)

        (
            FixedColumnWidthTable(number_of_columns=2, number_of_rows=4)
            .append_layout_element(Chunk("BMP"))
            .append_layout_element(Chunk("JPG"))
            .append_layout_element(
                Image(
                    bytes_path_pil_image_or_url=TestImageTypes.PINEAPPLE_BMP,
                    size=(100, 100),
                )
            )
            .append_layout_element(
                Image(
                    bytes_path_pil_image_or_url=TestImageTypes.PINEAPPLE_JPG,
                    size=(100, 100),
                )
            )
            .append_layout_element(Chunk("PNG"))
            .append_layout_element(Chunk(" "))
            .append_layout_element(
                Image(
                    bytes_path_pil_image_or_url=TestImageTypes.PINEAPPLE_PNG,
                    size=(100, 100),
                )
            )
            .append_layout_element(Chunk(" "))
            .set_padding_on_all_cells(
                padding_bottom=5, padding_left=5, padding_right=5, padding_top=5
            )
        ).paint(available_space=(x, y, w, h), page=p)

        PDF.write(what=d, where_to="assets/test_image_types.pdf")
